import React from "react";
import LogoImg from "../../assets/logo.png";
import { Container, Logo, Menu } from "./styles";
import { Link } from "react-router-dom";

const Header = () => {
    return (
        <Container>
            <Logo>
                <Link to="/"><img src={LogoImg} alt="" /></Link>

            </Logo>
            <Menu>
                <ul>
                    <li>
                        <Link>
                            <span>
                                Cadastro/Login
                            </span>
                        </Link>
                    </li>
                </ul>
            </Menu>
        </Container>
    )
}

export default Header;
